import './App.css';


import HomePageDesign from './pages/HomePageDesign';
import HomePageEngineering from './pages/HomePageEngineering';
import About from './pages/About';
import Resume from './pages/Resume';
import DesignWork from './pages/DesignWork';
import EngineeringWork from './pages/EngineeringWork';

import React, { Component } from 'react';
import {
  HashRouter,
  Route,
} from 'react-router-dom';

import Navbar from './components/Navbar';
import ScrollToTopRoute from './components/ScrollToTopRoute';

class App extends Component {
  render(){
    return (
      <HashRouter>
          <Navbar />

          <Routes>
            <Route path="/" component ={HomePageDesign} exact />
            <Route path="/about" component ={About} exact />
            <Route path="/resume" component ={Resume} exact />

            <Route path="/design" component ={HomePageDesign} exact />
            <Route path="/design-work" component ={DesignWork} exact />

            <Route path="/engineering" component ={HomePageEngineering} exact />
            <Route path="/engineering-work" component ={EngineeringWork} exact />
            </Routes>
      </HashRouter>
    );
  }
}

export default App;
